import React from 'react';
import './Body.css';

export default function Body(rooms) {
    let num = 0;
    return (
        <div id="body">
            BODY

            <div>
                {rooms.map(room => (
                    <div key={num}>{room.host} _ {room.game}</div>
                ))}
            </div>
        </div>   
    )
}
